import React, { useEffect } from 'react';
// import { capitalizeFirstLetter } from 

function Nav(props) {
    const {
        pages = [],
        setCurrentPage,
        currentPage,
    } = props;

    useEffect(() => {
        document.title = capitalizeFirstLetter(currentPage.name);
    }, [currentPage]);

    return (
        <nav>
            <ul className="flex-row">
                {pages.map}
            </ul>
        </nav>
    )
}
